import React, { Component, PropTypes } from 'react';
import LinearProgress from '@material-ui/core/LinearProgress';
import axios from 'axios';
import Top5 from '../components/top5';
import { Grid } from '@material-ui/core';
import Typography from '@material-ui/core/Typography';
import WorldMap from '../components/worldMap';

class Home extends Component {
    constructor(props) {
        super(props);

    }
    state={
        top5:null,
        world:67
    };
    componentDidMount(){
        // axios.get('/getCounts').then(res=>{
        //     console.log(res);
        //     this.setState({
        //         top5:res.data
        //     })
        // }).catch(err=>{
        //     console.log(err)
        // });
        // axios.get('/getWorldmap').then(res=>{
        //     console.log(res);
        //     this.setState({
        //         world:res.data
        //     })
        // }).catch(err=>{
        //     console.log(err)
        // })
    }


    render() {
        let displaytop5=this.state.top5? (
        <div>
            <Top5 top5={this.state.top5}></Top5>
        </div>):
        <div className="padding10per">
        <Typography color="textSecondary">Loading...</Typography><LinearProgress color="secondary" />
        </div>;
        let displayWorld=this.state.world? (
            <div>
                <WorldMap world={this.state.world}></WorldMap>
            </div>):
            <div className="padding10per">
            <Typography color="textSecondary">Loading...</Typography><LinearProgress color="secondary" />
            </div>;
        return(
        <Grid container>
                <Grid item sm={12} xs={12}>
                    <h4><center>Top 5 Most Affected States as of 11 June 2020</center></h4>
                <div>{displaytop5}</div>
                </Grid>
                <Grid item sm={12} xs={12}>
                    <h4><center>World</center></h4>
                <div>{displayWorld}</div>
                <div id="myDiv"></div>
                </Grid>
            </Grid>
        );
    }
}

Home.propTypes = {

};

export default Home;
